import React, { Component } from 'react';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
} from 'reactstrap';
import Particles from 'react-particles-js';
import logo from './logo.svg';
import SkillBar from 'react-skillbars';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';

SKILLS = [
  {
    "type": "Java",
    "level": 100,
    "color": {
      "bar": "#3498db",
      "title": {
        "text": "#fff",
        "background": "#2980b9"
      }
    }
  },
  {
    "type": "React",
    "level": 85,
    "color": {
      "bar": "#4288d0",
      "title": {
        "text": "#fff",
        "background": "#124e8c"
      }
    }
  },
  {
    "type": "Javascript",
    "level": 75,
    "color": {
      "bar": "#2c3e50",
      "title": {
        "text": "#fff",
        "background": "#2c3e50"
      }
    }
  },
  {
    "type": "Spring",
    "level": 50,
    "color": {
      "bar": "#5a68a5",
      "title": {
        "text": "#fff",
        "background": "#46465e"
      }
    }
  },
  {
    "type": "Docker",
    "level": 25,
    "color": {
      "bar": "#525252",
      "title": {
        "text": "#fff",
        "background": "#333333"
      }
    }
  },
  {
    "type": "HTML",
    "level": 20,
    "color": {
      "bar": "black",
      "title": {
        "text": "#111",
        "background": "#fff"
      }
    }
  },
  {
    "type": "NoSQL",
    "level": 0,
    "color": {
      "bar": "#2ecc71",
      "title": {
        "text": "#fff",
        "background": "#27ae60"
      }
    }
  }
]

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  render() {
    return (
      <div>
        <Navbar color="light" light expand="md">
          <NavbarBrand href="/">Clay Palumbo</NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="/components/">About</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="https://github.com/reactstrap/reactstrap">Applications</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Social Pages
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                    Github
                  </DropdownItem>
                  <DropdownItem>
                    LinkedIn
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
        <div className="App" style={{backgroundColor: "black"}}>
        <Particles 
              params={{
                "particles": {
                    "number": {
                        "value": 50
                    },
                    "size": {
                        "value": 3
                    }
                },
                "interactivity": {
                    "events": {
                        "onhover": {
                            "enable": true,
                            "mode": "repulse"
                        }
                    }
                }
            }}/>
            <SkillBar skills={this.SKILLS}/>

          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p>
              Edit <code>src/App.js</code> and save to reload.
        </p>
            <a
              className="App-link"
              href="https://reactjs.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              Learn React
        </a>
          </header>
        </div>
      </div>
    );
  }
}


export default App;
